const selectOptions = [
  {
    text: "Notion",
    value: "Notion",
    graphicsProps: {
      image:
        "https://upload.wikimedia.org/wikipedia/commons/4/45/Notion_app_logo.png",
    },
  },
  {
    text: "Jira",
    value: "Jira",
    graphicsProps: {
      image:
        "data:image/jpeg;base64,",
    },
  },
  {
    text: "Slack",
    value: "Slack",
    graphicsProps: {
      image:
        "data:image/png;base64,",
    },
  },
  {
    text: "MS Azure",
    value: "MS Azure",
    graphicsProps: {
      image:
        "data:image/jpeg;base64,",
    },
  },
  {
    text: "Noimics",
    value: "Noimics",
    graphicsProps: {
      image:
        "data:image/png;base64,",
    },
  },

  {
    text: "NoopenSpeed",
    value: "NoopenSpeed",
    graphicsProps: {
      image:
        "data:image/jpeg;base64,",
    },
  },
];

function delay(ms) {
    return new Promise(rs => setTimeout(rs,ms))
}
function Search({ elementRef, handleChange}) {

  const searchFn = async (value, source) => {
    // mimic xhr
    await delay(1000)
    const result = selectOptions.filter((x) =>
      x.text.toLowerCase().includes(value.toLowerCase())
    );
    return result.map((x) => {
      return {
        text: x.text,
        value: x.value,
        graphicsProps: { image: x.graphicsProps.image },
      };
    });
  };
  return (
    <div className="my-6">
      <SearchHeader />
      
      <div className="my-6">
      <FwSelect
        id="dynamicSelect"
        variant="mail"
        notFoundText="This product is not available yet."
        placeholder="ðŸ”   Search for any software..."
        optionsVariant="avatar"
        tagVariant="avatar"
        search={searchFn}
        multiple
        ref={elementRef}
        onFwChange={handleChange}
      ></FwSelect>
      </div>

      <button className="bg-gradient-to-r from-purple-600 to-purple-400 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded-lg w-full"
      
        onClick={async () => {
          console.log(await elementRef.current.getSelectedItem());
          alert("Check console for selected Apps")
        }}
      >Next</button>
    
    </div>
  );
}

export default Search;
